function veranios() {
  var UrlMensaje =
    localStorage.getItem("ls_url2").toLocaleString() +
    "/Services/TG/Parametros.svc/ParametroEmpGet/6,;TL;SALES_BY_SERVICES;;NUMERO_ANIOS";
  var aniosmensa = "4";
  $.ajax({
    url: UrlMensaje,
    type: "GET",
    dataType: "json",
    async: false,
    success: function (data) {
      try {
        aniosmensa = JSON.parse(data.ParametroEmpGetResult).tmpParamEmp;
        aniosmensa = aniosmensa[0];
      } catch (e) {
        kendo.ui.progress($("#lector_barrasScreen"), false);
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i>2 ERROR</center>',
          "No existe conexi&oacute;n con el servicio Tipo Trabajo"
        );
        return aniosmensa;
      }
    },
    error: function (err) {
      kendo.ui.progress($("#lector_barrasScreen"), false);
      //  window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> ERROR</center>", "No existe conexi&oacute;n con el servicio Tipo Trabajo");
      return aniosmensa;
    },
  });
  return aniosmensa;
}
