function scanCitas() {
  var that = this;
  try {
    if (window.navigator.simulator === true) {
      // loading
      document.getElementById("divLoading").innerHTML = "";
      // Borrar imagen de placa
      document.getElementById("smallImage").style.display = "none";

      window.myalert(
        '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
        "Aplicaci\u00F3n no compatible."
      );
    } else {
      cordova.plugins.barcodeScanner.scan(
        function (result) {
          if (!result.cancelled) {
            var empsucage = result.text.split(",");
            if (empsucage.length != 2) {
              alert("Codigo QR inválido, imposible abrir orden de trabajo");
            } else {
              kendo.ui.progress($("#lector_barrasScreen"), true);
              setTimeout(function () {
                var citas = consultarCitaSql(
                  result.text.split(",")[0],
                  result.text.split(",")[1]
                );
                var url = localStorage.getItem("ls_url2").toString();
                if (citas.dt9 == null) {
                  window.myalert(
                    "<center><img style='width: 1em; height: 1em;' src='./res/android/drawable-hdpi/check-01.svg'></img> Consulta de citas</center>",
                    "No tiene llave ERP"
                  );
                } else {
                  if (citas.dt2 == null) {
                    window.myalert(
                      "<center><img style='width: 1em; height: 1em;' src='./res/android/drawable-hdpi/check-01.svg'></img> Consulta de citas</center>",
                      "Cita creada sin placa, imposible generar OT automáticamente"
                    );
                  } else {
                    var params =
                      citas.dt9 +
                      ";" +
                      localStorage.getItem("ls_idempresa").toString() +
                      ";" +
                      localStorage.getItem("ls_ussucursal").toString() +
                      ";" +
                      localStorage.getItem("ls_usagencia").toString();
                    generarOTCitaTaller(params, url);
                  }
                }
              }, 2000);
            }
          }
        },
        function (error) {
          alert("07" + error);
        }
      );
    }
  } catch (e) {
    kendo.ui.progress($("#lector_barrasScreen"), false);
    alert("08" + e);
  }
  kendo.ui.progress($("#lector_barrasScreen"), false);
}
function generarOTCitaTaller(params, url) {
  var respuesta;
  try {
    var Url = url + "/Services/TL/Taller.svc/tl06OrdenesGet/22,json;" + params;
    kendo.ui.progress($("#lector_barrasScreen"), true);
    setTimeout(function () {
      $.ajax({
        url: Url,
        type: "GET",
        async: false,
        dataType: "json",
        headers: {
          "Content-Type": "application/json;charset=UTF-8",
        },
        success: function (data) {
          try {
            respuesta = data.tl06OrdenesGetResult;
            if (respuesta != null && respuesta.includes("Success") == true) {
              window.myalert(
                '<center><i class="fa fa-check-circle-o"></i><br /> Registro exitoso<br /> Orden de trabajo </center>',
                "<center><br /> <span style='font-size: 2em; color:black;'>#" +
                  "  " +
                  respuesta.split(",")[2] +
                  "</span> <br /></center"
              );
              document.getElementById("infoPlacasVIN").value =
                respuesta.split(",")[2];
              document.getElementById("infoPlacasVIN").innerHTML =
                respuesta.split(",")[2];
              TraerInformacion(respuesta.split(",")[2], "O");
            } else {
              if (respuesta == null) {
                respuesta =
                  "No se puedo generar la orden de trabajo respuesta esta en null";
              }
              window.myalert(
                "<center><img style='width: 1em; height: 1em;' src='./res/android/drawable-hdpi/check-01.svg'></img> Locación incorrecta</center>",
                respuesta
              );
            }
          } catch (e) {
            alert("10" + e);
            alert("No existe datos para esta consulta", "mens");
            kendo.ui.progress($("#lector_barrasScreen"), false);
            return;
          }
        },
        error: function (err) {
          alert("generar cita" + inspeccionar(err));
          alert("Alerta en consulta OT", "mens");
          kendo.ui.progress($("#lector_barrasScreen"), false);
          return;
        },
      });
    }, 2000);
  } catch (e) {
    alert("11" + e);
    alert("Alerta de conexi" + String.fromCharCode(243) + "n a base", "mens");
    kendo.ui.progress($("#lector_barrasScreen"), false);
    return;
  }
  kendo.ui.progress($("#lector_barrasScreen"), false);
}
function consultarCitaSql(cedula, idCita) {
  var infor;
  try {
    var params = {
      Dt1: cedula,
      Id: idCita,
    };
    $.ajax({
      url: UrlCitasTaller,
      type: "POST",
      data: JSON.stringify(params),
      async: false,
      dataType: "json",
      headers: {
        "Content-Type": "application/json;charset=UTF-8",
      },
      success: function (datas) {
        try {
          infor = datas;
          for (var index = 0; index < infor.length; index++) {
            infor[index].dt20 = infor[index].ddt1.substring(0, 10);
          }
          infor = infor[0];
        } catch (e) {
          alert("12" + e);
          alert("No existe datos para esta consulta", "mens");
          kendo.ui.progress($("#lector_barrasScreen"), false);
          return;
        }
      },
      error: function (err) {
        alert("consultar cita" + inspeccionar(err));
        alert("Alerta en consulta OT", "mens");
        kendo.ui.progress($("#lector_barrasScreen"), false);
        return;
      },
    });
  } catch (e) {
    alert("13" + e);
    mens("Alerta de conexi" + String.fromCharCode(243) + "n a base", "mens");
    kendo.ui.progress($("#lector_barrasScreen"), false);
    return;
  }
  kendo.ui.progress($("#lector_barrasScreen"), false);
  return infor;
}

