function uploadVideo(mediaFile) {
  try {
    document.getElementById("divOTVideosCont").innerHTML = "";
    document.getElementById("videosOT").innerHTML = "";

    var mediaPlayer = "";

    var ft = new FileTransfer(),
      path = mediaFile.fullPath,
      name = mediaFile.name;

    var videoURI = path;

    var vidPorcentaje = 80;
    var vidAlto = (screen.width * 50) / 100;
    var vidAncho = (screen.width * 80) / 100;

    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth() + 1; //Enero is 0

    var yyyy = today.getFullYear();
    if (dd < 10) {
      dd = "0" + dd;
    }
    if (mm < 10) {
      mm = "0" + mm;
    }

    var hhmm = new Date().toLocaleTimeString("en-US", {
      hour12: false,
      hour: "numeric",
      minute: "numeric",
      second: "numeric",
    });

    hhmm = hhmm.replace(":", "");
    var arrExtension = videoURI.split(".");

    var camposOT = parametrosOTCompleto();
    var pathServidorOT =
      camposOT["descripcion-2"] +
      "\\" +
      document.getElementById("numOT_2").value +
      "_" +
      localStorage.getItem("ls_ussucursal").toLocaleString() +
      "_" +
      localStorage.getItem("ls_usagencia").toLocaleString();

    var fileVideo =
      localStorage.getItem("ls_empresa").toLocaleString().substring(0, 5) +
      "_" +
      localStorage.getItem("ls_ussucursal").toLocaleString() +
      "_" +
      localStorage.getItem("ls_usagencia").toLocaleString() +
      "_" +
      document.getElementById("numOT_2").value +
      "_" +
      yyyy +
      mm +
      dd +
      "_" +
      hhmm.replace(":", "") +
      "." +
      arrExtension[1];

    fileVideo = fileVideo + "|" + fileVideo + "|" + pathServidorOT;

    var options = new FileUploadOptions();
    options.fileKey = "file";
    options.fileName = fileVideo;
    options.mimeType = "video/mp4";

    var params = new Object();
    params.value1 = "test";
    params.value2 = "param";
    options.params = params;
    options.chunkedMode = false;

    // Variable del archivo
    var ft = new FileTransfer();
    // Presenta el porcentaje de subida de la imagen
    ft.onprogress = function (progressEvent) {
      if (progressEvent.llengthComputable) {
        var perc = Math.floor(
          (progressEvent.loaded / progressEvent.total) * 100
        );
        document.getElementById("videosOT").innerHTML = "";
        document.getElementById("statusDom").innerHTML =
          "<br/><center><i class='fa fa-cog fa-spin fa-lg'></i><br/><b>" +
          perc +
          "% guardando...</b></center>";
      } else {
        if (document.getElementById("statusDom").innerHTML == "") {
          document.getElementById("statusDom").innerHTML = "guardando";
        } else {
          var perc = Math.floor(
            (progressEvent.loaded / progressEvent.total) * 100
          );
          document.getElementById("statusDom").innerHTML =
            "<br/><center><i class='fa fa-cog fa-spin fa-lg'></i><br/><b>" +
            perc +
            "% guardando...</b></center>";
        }
      }
    };

    // Ejecuta el proceso de subida de la imagen
    // http://ecuainfo78-002-site3.btempurl.com/FileUpload.asmx/guardaArchivo

    //  var UrlSube = "http://localhost:4044/Services/TL/Taller.svc/guardaArchivoEntrega";

    var UrlSube =
      localStorage.getItem("ls_url2").toLocaleString() +
      "/Services/TL/Taller.svc/guardaArchivoEntrega";

    ft.upload(
      videoURI,
      UrlSube,
      function (result) {
        //alert(videoURI+"   "+UrlSube);

        document.getElementById("statusDom").innerHTML = "";
        verArchivosOT_2(document.getElementById("numOT_2").value);
        DesplegarFotoVideo();
        kendo.ui.progress($("#lector_barrasScreen"), false);
      },
      function (error) {
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i>1 ERROR</center>',
          inspeccionar(error)
        );
      },
      options
    );
  } catch (e) {
    window.myalert(
      '<center><i class="fa fa-exclamation-triangle"></i>2 ERROR</center>',
      e
    );
  }
}

