/*--------------------------------------------------------------------
Fecha: 12/12/2017
Detalle: Sube el imagenes al repositorio
Autor: RRP
--------------------------------------------------------------------*/
function parametrosOTCompleto() {
  try {
    var accResp = "";

    //http://192.168.1.50:8089/concesionario/Services/TG/Parametros.svc/ParametroEmpGet/6,;TG;APP_ENTREGAS;;PATH_ENTREGAS

    var Url =
      localStorage.getItem("ls_url2").toLocaleString() +
      "/Services/TG/Parametros.svc/ParametroEmpGet/6,;TG;APP_ENTREGAS;;PATH_ENTREGAS";

    //  window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> Url</center>", Url);

    var respPar;

    $.ajax({
      url: Url,
      type: "GET",
      dataType: "json",
      async: false,
      success: function (data) {
        try {
          accResp = JSON.parse(data.ParametroEmpGetResult).tmpParamEmp;
          respPar = accResp[0];
        } catch (e) {
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
            inspeccionar(e)
          );
          respPar = "error";
        }
      },
      error: function (err) {
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
          inspeccionar(err)
        );
        respPar = "error";
      },
    });

    return respPar;
  } catch (f) {
    window.myalert(
      '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
      f
    );
    return "error";
  }
}

