function buscaPlacaVIN(placaVIN) {
  // Destruye el grid
  try {
    // Grid detalle ot
    var grid = $("#datosOT").data("kendoGrid");
    grid.destroy();
  } catch (ex) {}
  /* try {
    // Grid detalle ot
    document.getElementById("packsGrid").style.display = "none";
    var grid = $("#packsGrid").data("kendoGrid");
    grid.dataSource.data([]);
    grid.setDataSource([]);
    grid.destroy();
  } catch (ex) {} */

  // Borrar imagen de placa
  document.getElementById("smallImage").style.display = "none";

  if (document.getElementById("infoPlacasVIN").value != "") {
    kendo.ui.progress($("#lector_barrasScreen"), true);
    setTimeout(function () {
      // precarga----------------------------

      if (placaVIN.includes("*") == true) {
        listaVin(placaVIN);
      } else {
        if (placaVIN.length > 8) {
          var patron = /^\d*$/;
          if (patron.test(placaVIN)) {
            TraerInformacion(placaVIN, "O");
          } else {
            // Busca la placa con los datos del cliente de cita
            if (
              localStorage.getItem("ls_agendaplaca") != undefined &&
              localStorage.getItem("ls_agendaplaca").toLocaleString() == "n/e"
            ) {
              TraerInformacionClienteCita(placaVIN, "C");
              return;
            } else {
              TraerInformacion(placaVIN, "C");
            }
          }
        } else {
          // Busca la placa con los datos del cliente de cita
          if (
            localStorage.getItem("ls_agendaplaca") != undefined &&
            localStorage.getItem("ls_agendaplaca").toLocaleString() == "n/e"
          ) {
            TraerInformacionClienteCita(placaVIN, "P");
            return;
          } else {
            TraerInformacion(placaVIN, "P");
          }
        }
      }

      // precarga----------------------------
    }, 2000);
  } else {
    // loading
    document.getElementById("divLoading").innerHTML = "";
    // Borrar imagen de placa
    document.getElementById("smallImage").style.display = "none";
    window.myalert(
      '<center><i class="fa fa-exclamation-triangle"></i>9 ALERTA</center>',
      "Ingrese la Placa o VIN"
    );
  }
}

