function enviaMail(asunto, contenido, correo) {
  window.plugins.socialsharing.shareViaEmail(
    contenido, // can contain HTML tags, but support on Android is rather limited:  http://stackoverflow.com/questions/15136480/how-to-send-html-content-with-image-through-android-default-email-client
    asunto,
    [correo], // TO: must be null or an array
    null, // CC: must be null or an array
    null, // BCC: must be null or an array
    null, // FILES: can be null, a string, or an array
    onSuccess, // called when sharing worked, but also when the user cancelled sharing via email. On iOS, the callbacks' boolean result parameter is true when sharing worked, false if cancelled. On Android, this parameter is always true so it can't be used). See section "Notes about the successCallback" below.
    onError // called when sh*t hits the fan
  );
}

