/*--------------------------------------------------------------------
Fecha: 09/01/2018
Detalle: Cierra la OT
Parametros: Numero OT
Autor: RRP
--------------------------------------------------------------------*/
function onSelecciona(etab) {
  var tabItem = $(etab.item).find("> .k-link").text();

  if (tabItem == "HE") {
    // Estado Mantenimiento
    if (localStorage.getItem("ls_itemHE") == undefined) {
      ConsultarEM(document.getElementById("chasis").value);
      localStorage.setItem("ls_itemHE", "HE");
    }
  } else if (tabItem == "HO") {
    // Historial OT
    if (localStorage.getItem("ls_itemHO") == undefined) {
      ConsultarOT(
        document.getElementById("chasis").value,
        document.getElementById("dpInicio").value,
        document.getElementById("dpFin").value
      );
      localStorage.setItem("ls_itemHO", "HO");
    }
  } else if (tabItem == "PA") {
    // packs
    if (localStorage.getItem("ls_itemPA") == undefined) {
      //consultarPacks(document.getElementById("chasis").value);
      localStorage.setItem("ls_itemPA", "PA");
    }
  } else if (tabItem == "VI") {
    // Archivos registrados
    if (localStorage.getItem("ls_itemVI") == undefined) {
      //verArchivosOT(document.getElementById('numOT_2').value);
      verArchivosOT_2(document.getElementById("numOT_2").value);

      localStorage.setItem("ls_itemVI", "VI");
    }
  } else if (tabItem == "MO") {
    // Mano de Obra

    if (localStorage.getItem("ls_itemMO") == undefined) {
      ConsultarMO(
        document.getElementById("numOT_2").value,
        document.getElementById("secuencia_orden").value
      );
      localStorage.setItem("ls_itemMO", "MO");
    }
  }
}

function elimStrgItem() {
  var arrItem = [
    "ls_itemHE",
    "ls_itemPA",
    "ls_itemHO",
    "ls_itemVI",
    "ls_itemMO",
  ];
  for (var i = 0; i < arrItem.length; i++) {
    if (localStorage.getItem(arrItem[i]) != undefined) {
      localStorage.removeItem(arrItem[i]);
    }
  }
}

