/*--------------------------------------------------------------------
Fecha: 30/10/2017
Detalle: Carga combo de tipo de citas
Autor: RRP
--------------------------------------------------------------------*/
function cboCita(selCita) {
  var cboCitaHTML =
    "<p><label id='lblCita' class='w3-text-red'><b>Tipo Cita</b></label><select id='tipo_cita' class='w3-input w3-border textos'>";
  cboCitaHTML += "<option  value=' '>Ninguno</option>";
  cboCitaHTML += "</select></p>";

  // http://186.71.21.170:8077/taller/Services/TG/Parametros.svc/ComboParametroEmpGet/13,1;TL;TIPO_CITA;;;;;;

  var UrlCboCitas =
    localStorage.getItem("ls_url2").toLocaleString() +
    "/Services/TG/Parametros.svc/ComboParametroEmpGet/13," +
    localStorage.getItem("ls_idempresa").toLocaleString() +
    ";TL;TIPO_CITA;;;;;;";

  var cboCitaResp = "";

  $.ajax({
    url: UrlCboCitas,
    type: "GET",
    dataType: "json",
    async: false,
    success: function (data) {
      try {
        cboCitaResp = JSON.parse(data.ComboParametroEmpGetResult);
      } catch (e) {
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i>2 ERROR</center>',
          "No existe conexi&oacute;n con el servicio Tipo Cita"
        );
        return;
      }
    },
    error: function (err) {
      //  window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> ERROR</center>", "No existe conexi&oacute;n con el servicio Tipo Cita");
      return;
    },
  });

  if (cboCitaResp.length > 0) {
    cboCitaHTML =
      "<p><label id='lblCita' class='w3-text-red'><b>Tipo Cita</b></label><select id='tipo_cita'  class='w3-input w3-border textos'>";

    for (var i = 0; i < cboCitaResp.length; i++) {
      if (
        cboCitaResp[i].CodigoClase != " " ||
        cboCitaResp[i].CodigoClase != "ninguna"
      ) {
        if (selCita == cboCitaResp[i].CodigoClase) {
          cboCitaHTML +=
            "<option  value='" +
            cboCitaResp[i].CodigoClase +
            "' selected>" +
            cboCitaResp[i].NombreClase +
            "</option>";
        } else {
          cboCitaHTML +=
            "<option  value='" +
            cboCitaResp[i].CodigoClase +
            "'>" +
            cboCitaResp[i].NombreClase +
            "</option>";
        }
      }
    }

    cboCitaHTML += "</select></p>";
  } else {
    cboCitaHTML =
      "<p><label id='lblCita' class='w3-text-red'><b>Tipo Cita</b></label><select id='tipo_cita' class='w3-input w3-border textos'>";
    cboCitaHTML += "<option  value=' '>Ninguno</option>";
    cboCitaHTML += "</select></p>";
  }

  var estado =
    "<p><label id='lblCita' class='w3-text-red'><b>Estado</b></label><input id='estado_cita' class='w3-input textos' value='ABIERTO'/></p>";

  var tabla =
    "<table width='100%'><tr><td>" +
    cboCitaHTML +
    "</td><td>" +
    estado +
    "</td></tr></table>";

  document.getElementById("divcboCita").innerHTML = estado + cboCitaHTML;
}

