/*--------------------------------------------------------------------
Fecha: 02/01/2018
Descripcion: Elimina registro de Mano de Obra
Parametros: - url elimina
            - codigo OT
--------------------------------------------------------------------*/
function eliminaMo(urlElim, numOT, SecuenciaOT) {
  //  window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> 1ERROR</center>", urlElim);

  kendo
    .confirm(
      '<center><h1><i class="fa fa-trash"></i> ELIMINAR</h1><br />Desea Eliminar el Registro ?</center>'
    )
    .done(function () {
      $.ajax({
        url: urlElim,
        type: "GET",
        async: false,
        dataType: "json",
        success: function (data) {
          try {
            kendo.ui.progress($("#lector_barrasScreen"), true);
            setTimeout(function () {
              // precarga *********************************************************************************************

              if (inspeccionar(data).includes("Succes") == true) {
                window.myalert(
                  '<center><i class="fa fa-check-circle-o"></i> ELIMINADO</center>',
                  "El Registro fue eliminado correctamente"
                );
                ConsultarMO(numOT, SecuenciaOT);
              } else {
                kendo.ui.progress($("#lector_barrasScreen"), false);
                window.myalert(
                  '<center><i class="fa fa-exclamation-triangle"></i> 1ERROR</center>',
                  "<center>No se ha podido eliminar el Registro<br />" +
                    inspeccionar(data) +
                    "</center>"
                );
                return;
              }

              kendo.ui.progress($("#lector_barrasScreen"), false);
              // precarga *********************************************************************************************
            }, 2000);
          } catch (e) {
            kendo.ui.progress($("#lector_barrasScreen"), false);
            window.myalert(
              '<center><i class="fa fa-exclamation-triangle"></i> 2ERROR</center>',
              "<center>Error durante el proceso.<br />" + e + "</center>"
            );
            return;
          }
        },
        error: function (err) {
          kendo.ui.progress($("#lector_barrasScreen"), false);
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i> 3ERROR</center>',
            "<center>Error durante el proceso.<br />" +
              inspeccionar(err) +
              "</center>"
          );
          return;
        },
      });
    })
    .fail(function () {
      kendo.ui.progress($("#lector_barrasScreen"), false);
      // Elimina el localstorage con la feha y hora de la cita
      // localStorage.removeItem("ls_citafechahora");
    });
  llamarColorBotonGeneral(".k-primary");
}

