function accionEnviaCorreo(e) {
  var tipomail = document.getElementById("tipomail").value;
  var mailOT = document.getElementById("numOT_2").value;
  var emisor = localStorage.getItem("ls_usumail").toLocaleString();
  var receptor = document.getElementById("mail_1").value;
  var receptor_2 = document.getElementById("mail_2").value;
  var smscel = document.getElementById("smscel").value;
  var obsdiagnostico = document.getElementById("obsdiagnostico").value;

  if (receptor.trim() == "") {
    if (tipomail == "D") {
      enviaMailDiagnostico();
    } else {
      enviaMailRecepcion();
    }
    window.myalert(
      '<center><i class="fa fa-exclamation-triangle"></i>41 ERROR</center>',
      "Ingrese la Direcci&oacute;n de Correo correctamente"
    );
    return;
  } else {
    var re =
      /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    if (re.test(receptor) == false) {
      window.myalert(
        '<center><i class="fa fa-exclamation-triangle"></i>42 ERROR</center>',
        "Ingrese la Direcci&oacute;n de Correo correctamente"
      );
      return;
    }

    if (receptor_2.trim() != "" && re.test(receptor_2) == false) {
      if (tipomail == "D") {
        enviaMailDiagnostico();
      } else {
        enviaMailRecepcion();
      }

      window.myalert(
        '<center><i class="fa fa-exclamation-triangle"></i>43 ERROR</center>',
        "Ingrese la Direcci&oacute;n de Correo Copia correctamente"
      );
      return;
    }

    if (receptor == receptor_2) {
      receptor_2 = "";
    }

    var arrTelUsu = localStorage
      .getItem("ls_usutelf")
      .toLocaleString()
      .split(".");

    var cuerpo;

    if (tipomail == "D") {
      if (obsdiagnostico.trim() == "") {
        enviaMailDiagnostico();
        window.myalert(
          '<center><i class="fa fa-paper-plane"></i>44 ERROR</center>',
          "Ingrese las Observaciones"
        );
        return;
      }
    } else {
      obsdiagnostico = "";
      smscel = "";
    }

    var llavemail =
      localStorage.getItem("ls_usulog").toLocaleString() +
      ";" +
      localStorage.getItem("ls_idempresa").toLocaleString() +
      ";" +
      localStorage.getItem("ls_ussucursal").toLocaleString() +
      ";" +
      localStorage.getItem("ls_usagencia").toLocaleString() +
      ";" +
      document.getElementById("placa").value +
      ";" +
      document.getElementById("chasis").value +
      ";" +
      document.getElementById("numOT_2").value;

    var params = {
      mail_receptor: receptor,
      mail_copia: receptor_2,
      observaciones: obsdiagnostico,
      adjuntos: smscel, // celular
      imagenes: document.getElementById("otadjuntos").value,
      videos: "",
      otros: llavemail,
    };

    //   var Url = "http://localhost:4044/Services/TL/Taller.svc/tl06EnvioMailSet";
    var Url =
      localStorage.getItem("ls_url2").toLocaleString() +
      "/Services/TL/Taller.svc/tl06EnvioMailSet";

    $.ajax({
      url: Url,
      type: "POST",
      data: JSON.stringify(params),
      dataType: "json",
      headers: {
        "Content-Type": "application/json;charset=UTF-8",
      },
      success: function (data) {
        try {
          var respMail = JSON.stringify(data);
          if (respMail.includes("Succes")) {
            window.myalert(
              '<center><i class="fa fa-paper-plane"></i> ENVIADO</center>',
              "El mensaje fue enviado correctamente"
            );
          } else {
            window.myalert(
              '<center><i class="fa fa-exclamation-triangle"></i>45 ERROR</center>',
              data
            );
            return;
          }
        } catch (e) {
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i>46 ERROR</center>',
            e
          );
          return;
        }
      },
      error: function (err) {
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i>3 ERROR</center>',
          JSON.stringify(err)
        );
        return;
      },
    });
  }
}

