function fechahoraControl(fecha, hora) {
  var valorFH = fecha + " " + hora;

  if (fecha == "" && hora == "") {
    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth() + 1; //Enero is 0

    var yyyy = today.getFullYear();
    if (dd < 10) {
      dd = "0" + dd;
    }
    if (mm < 10) {
      mm = "0" + mm;
    }

    var hhmm = new Date().toLocaleTimeString("en-US", {
      hour12: false,
      hour: "numeric",
      minute: "numeric",
    });
    var arrHHMM = hhmm.split(":");

    var horaEntrega = parseInt(arrHHMM[0]) + 3;
    if (horaEntrega < 10) {
      horaEntrega = "0" + horaEntrega;
    }

    valorFH = yyyy + "-" + mm + "-" + dd + " " + horaEntrega + ":" + arrHHMM[1];

    //  valorFH = new Date();
  }

  $("#dtpEntrega").kendoDateTimePicker({
    value: valorFH, //new Date(),
    timeFormat: "HH:mm",
    format: "yyyy-MM-dd HH:mm",
    dateInput: true,
  });

  //$("#" + divControl).kendoDateTimePicker({
  //    value: valorFH, //new Date(),
  //    timeFormat: "HH:mm",
  //    format: "yyyy-MM-dd HH:mm",
  //    dateInput: true
  //});
}

function fechahoraControl2(divControl, fecha, hora) {
  var valorFH = fecha + " " + hora;

  if (fecha == "" && hora == "") {
    valorFH = new Date();
  }

  $("#" + divControl).kendoDateTimePicker({
    value: "", //valorFH,
    timeFormat: "HH:mm",
    format: "yyyy-MM-dd HH:mm",
    dateInput: true,

    change: function () {
      // var d = new Date(this.value());
      var d = new Date(this.value().setHours(this.value().getHours() + 3));

      var curr_date = d.getDate();
      var curr_month = d.getMonth() + 1;
      var curr_year = d.getFullYear();
      var curr_hh = d.getHours();
      var curr_mm = d.getMinutes();

      if (curr_mm < 10) {
        curr_mm = "0" + curr_mm;
      }
      if (curr_hh < 10) {
        curr_hh = "0" + curr_hh;
      }
      if (curr_date < 10) {
        curr_date = "0" + curr_date;
      }
      if (curr_month < 10) {
        curr_month = "0" + curr_month;
      }

      document.getElementById("dtpEntrega").value =
        curr_year +
        "-" +
        curr_month +
        "-" +
        curr_date +
        " " +
        curr_hh +
        ":" +
        curr_mm;
    },
  });
}

