function uploadVideo_3(mediaFile) {
  try {
    var tokenArchivo = "placa";
    var ft = new FileTransfer();
    (path = mediaFile.fullPath), (name = mediaFile.name);
    var vidPorcentaje = 80;
    var vidAlto = (screen.width * 50) / 100;
    var vidAncho = (screen.width * 80) / 100;
    var arrExtension = mediaFile.split(".");
    var camposOT = parametrosOTCompleto();
    var pathServidor = camposOT["descripcion-2"];

    // path donde se guarda la placa
    var pathServidor = camposOT["descripcion-2"] + "\\plates";

    var nombreArchivoEV =
      tokenArchivo + "." + arrExtension[arrExtension.length - 1];
    var fileVideo = mediaFile + "|" + nombreArchivoEV + "|" + pathServidor;
    var options = new FileUploadOptions();
    options.fileKey = "file";
    options.fileName = fileVideo;

    var params = new Object();
    params.value1 = "test";
    params.value2 = "param";
    options.params = params;
    options.chunkedMode = false;

    var UrlSube =
      localStorage.getItem("ls_url2").toLocaleString() +
      "/Services/TL/Taller.svc/guardaArchivoEntrega";

    kendo.ui.progress($("#lector_barrasScreen"), true);
    setTimeout(function () {
      // precarga *********************************************************************************************

      ft.upload(
        mediaFile,
        UrlSube,
        function (result) {
          var archivoRemoto =
            localStorage.getItem("ls_url2").toLocaleString() +
            "/entrega_vehiculos/plates/" +
            tokenArchivo;
          MIshowHint(archivoRemoto);
          kendo.ui.progress($("#lector_barrasScreen"), false);
        },
        function (error) {
          kendo.ui.progress($("#lector_barrasScreen"), false);
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
            inspeccionar(error)
          );
        },
        options
      );

      kendo.ui.progress($("#lector_barrasScreen"), false);
      // precarga *********************************************************************************************
    }, 2000);
  } catch (e) {
    kendo.ui.progress($("#lector_barrasScreen"), false);
    window.myalert(
      '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
      e
    );
    return;
  }
}

