function llenaTipMante(kilom, selMantenimiento) {
  try {
    var modo = "2";
    /* if (kilom=="" || kilom ==null) {
            modo="1";
        } else {
            modo="2";
        } */
    var codigoTra = "MP";
    var empresaerp = localStorage.getItem("ls_idempresa");
    var matchMantenim = 0;
    try {
      if (
        document.getElementById("trabajo2").value == null ||
        document.getElementById("trabajo2").value == "" ||
        document.getElementById("trabajo2").value == undefined
      ) {
        codigoTra = "MP";
      } else {
        codigoTra = document.getElementById("trabajo2").value;
      }
    } catch (error) {}
    try {
      document.getElementById("mantenimiento2").innerHTML = "";
      document.getElementById("divcboMantenimiento").innerHTML = "";
    } catch (error) {}
    var cboMantenimientoHTML =
      "<div class='select-style2'><p><select id='mantenimiento2'  class='w3-input w3-border textos'>";
    cboMantenimientoHTML += "<option  value=' '>Ninguno</option>";
    cboMantenimientoHTML += "</select> </p></div>";

    //document.getElementById("referencia_srg").type = "text";

    var paso = "0";
    //if (itmTrabajo == "MP" || itmTrabajo == "MANTENIMIENTO") {
    if (paso == "0") {
      //  http://186.71.21.170:8077/taller/Services/GA/Garantias.svc/OperacionesMantGet/1,

      var UrlCboMantenimientos =
        localStorage.getItem("ls_url2").toLocaleString() +
        "/Services/GA/Garantias.svc/OperacionesMantGet/" +
        modo +
        "," +
        empresaerp +
        ";" +
        codigoTra +
        ";" +
        kilom;
      //var UrlCboMantenimientos = "http://localhost:4044/Services/GA/Garantias.svc/OperacionesMantGet/"+modo+","+empresaerp+";"+codigoTra+";"+kilom;
      var cboMntResp = "";
      //window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> ERROR</center>", UrlCboMantenimientos);
      $.ajax({
        url: UrlCboMantenimientos,
        type: "GET",
        dataType: "json",
        async: false,
        success: function (data) {
          try {
            if (data.OperacionesMantGetResult == "") {
              cboMntResp = "";
              //window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i>1- ERROR</center>", "No existe información Tipo Mantenimiento");
            } else {
              cboMntResp = JSON.parse(data.OperacionesMantGetResult);
            }
          } catch (e) {
            kendo.ui.progress($("#lector_barrasScreen"), false);
            validaServicios = 0;
            window.myalert(
              '<center><i class="fa fa-exclamation-triangle"></i>1- ERROR</center>',
              "No existe conexi&oacute;n con el servicio Mantenimiento"
            );
            return;
          }
        },
        error: function (err) {
          kendo.ui.progress($("#lector_barrasScreen"), false);
          validaServicios = 0;
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i>2.- ERROR</center>',
            "No existe conexi&oacute;n con el servicio Mantenimiento"
          );
          return;
        },
      });
      //localStorage.setItem("cargaVariablesCombo",cargaVariables());
      var variablesCombo = cargaVariables(); //localStorage.getItem("cargaVariablesCombo");
      if (cboMntResp.length > 0) {
        if (cboMntResp[0].CodigoClase == "0") {
          kendo.ui.progress($("#lector_barrasScreen"), false);
          validaServicios = 0;
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
            cboMntResp[0].NombreClase
          );
          return;
        } else {
          cboMantenimientoHTML =
            "<div class='select-style2'> <p><select id='mantenimiento2'  class='w3-input w3-border textos'>";
          for (var i = 0; i < cboMntResp.length; i++) {
            //  if ("000 Km. (" + selMantenimiento + ")" == cboMntResp[i].CodigoClase) {
            if (
              /* infor.tipo_mantenimiento */ selMantenimiento ==
                cboMntResp[i].CodigoClase &&
              codigoTra != "0"
            ) {
              matchMantenim = 1;
              cboMantenimientoHTML +=
                "<option  value='" +
                cboMntResp[i].CodigoClase +
                "' selected>" +
                cboMntResp[i].NombreClase +
                "</option>";
            } else {
              cboMantenimientoHTML +=
                "<option  value='" +
                cboMntResp[i].CodigoClase +
                "'>" +
                cboMntResp[i].NombreClase +
                "</option>";
            }
          }
          cboMantenimientoHTML += "</select></p></div> ";
        }
      } else {
        cboMantenimientoHTML =
          "<div class='select-style2'><p><select id='mantenimiento2' class='w3-input w3-border textos'>";
        cboMantenimientoHTML += "<option  value=' '>Ninguno</option>";
        cboMantenimientoHTML += "</select></p></div> ";
      }
    } else if (codigoTra == "GA" || codigoTra == "GARANTIA") {
      document.getElementById("referencia_srg").value = "";
      document.getElementById("referencia_srg").type = "number";
    }
    document.getElementById("divcboMantenimiento").innerHTML =
      cboMantenimientoHTML;

    if (matchMantenim < 1) {
      document.getElementById("mantenimiento2").selectedIndex = "0";
      var arrVariables = variablesCombo.split(";");
      var varBandera = false;
      for (let index = 0; index < arrVariables.length; index++) {
        if (arrVariables[index] == codigoTra) {
          varBandera = true;
          index = arrVariables.length;
        }
      }
      if (varBandera) {
        document.getElementById("mantenimiento2").disabled = false;
      } else {
        document.getElementById("mantenimiento2").disabled = true;
      }
    }
  } catch (err) {
    alert("MANTE" + err);
  }
}

function getBase64Image(imgOT) {
  var urlImgFirma =
    localStorage.getItem("ls_url2").toLocaleString() +
    "/entrega_vehiculos/" +
    imgOT +
    "/" +
    imgOT +
    "_firm.jpeg";

  //  window.myalert("<center><i class=\"fa fa-exclamation-triangle\"></i> ERROR-urlImgFirma</center>", urlImgFirma);

  var img = document.createElement("IMG");
  img.setAttribute("src", urlImgFirma);
  img.setAttribute("width", "150");

  var canvas = document.createElement("canvas");
  canvas.width = 150;
  var ctx = canvas.getContext("2d");
  ctx.drawImage(img, 0, 0);
  var dataURL = canvas.toDataURL("image/jpeg");

  dataURL = "<img src='" + dataURL + "' width='150'>";

  return dataURL; //.replace(/^data:image\/(png|jpg);base64,/, "");
}

