/*--------------------------------------------------------------------
Fecha: 18/01/2018
Detalle: Crea archivo PDF en formato HTML y se guarda via FTP
Autor: RRP
--------------------------------------------------------------------*/
function creaPDF(codOT, htmlReporte) {
  var archivoPDF =
    localStorage.getItem("ls_empresa").toLocaleString().slice(0, 5) +
    "_" +
    localStorage.getItem("ls_ussucursal").toLocaleString() +
    "_" +
    localStorage.getItem("ls_usagencia").toLocaleString() +
    "_" +
    codOT;

  var params = {
    strArchivo: archivoPDF,
    strHTML: htmlReporte,
  };

  // "http://200.31.10.92:8092/appk_aekia/Services/TL/Taller.svc/creaPdf",
  var UrlPDF =
    localStorage.getItem("ls_url1").toLocaleString() +
    "/Services/TL/Taller.svc/creaPdf";

  // UrlPDF = "http://localhost:55034/FileUpload.asmx/creaPdf";  // local

  kendo.ui.progress($("#lector_barrasScreen"), true);
  setTimeout(function () {
    // precarga *********************************************************************************************

    $.ajax({
      url: UrlPDF,
      type: "POST",
      data: JSON.stringify(params),
      dataType: "json",
      headers: {
        "Content-Type": "application/json;charset=UTF-8",
      },
      success: function (data) {
        try {
          var respPdf = JSON.stringify(data);

          var MsjPdfOT =
            "<center>El archivo fue generado correctamente<br/>para la OT: <b>" +
            codOT +
            "</b></center>";

          if (respPdf.includes("error") == true) {
            kendo.ui.progress($("#lector_barrasScreen"), false);
            MsjPdfOT = respPdf.split(",")[1];
            window.myalert(
              '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
              MsjPdfOT
            );
            return;
          }

          window.myalert(
            '<center><i class="fa fa-file-pdf-o"></i> GENERADO</center>',
            MsjPdfOT
          );
          // return;
        } catch (e) {
          window.myalert(
            '<center><i class="fa fa-exclamation-triangle"></i> ERROR</center>',
            e
          );
          return;
        }
      },
      error: function (err) {
        window.myalert(
          '<center><i class="fa fa-exclamation-triangle"></i>3 ERROR</center>',
          JSON.stringify(err)
        );
        return;
      },
    });

    kendo.ui.progress($("#lector_barrasScreen"), false);
    // precarga *********************************************************************************************
  }, 2000);
}

