function firmaDigitalOT() {
  // OT - FIRMA
  try {
    var dialogfirmaDigitalOT = $("#dialogfirmaDigitalOT").data("kendoDialog");
    dialogfirmaDigitalOT.close();
  } catch (ed010) {}

  var htmlFirmaOT =
    "<table align='center' width='100%' style='border-bottom:1px solid'>" +
    "<tr>" +
    "<td>" +
    "<div id='idwrapOT' class='wrapper'><canvas id='signature-pad' width='400' height='300'></canvas></div>" +
    "</td>" +
    "</tr>" +
    "</table>";

  dialogfirmaDigitalOT = $("#dialogfirmaDigitalOT").kendoDialog({
    width: "450px",
    buttonLayout: "normal",
    title: "INGRESE LA FIRMA",
    closable: false,
    modal: false,
    content: htmlFirmaOT,
    actions: [
      {
        text: '<font style="font-size:12px"> <button id="save-jpeg" class="w3-btn"> &nbsp;&nbsp;CONFIRMAR&nbsp;&nbsp;</button></font>',
        action: accFirmConf,
      },
      {
        text: '<font style="font-size:12px"><button id="clear" class="w3-btn"> CANCELAR</button></font>',
        primary: true,
      },
    ],
  });
  dialogfirmaDigitalOT.data("kendoDialog").open();
  canvas = document.getElementById("signature-pad");
  signaturePad = new SignaturePad(canvas, {
    minWidth: 0.5,
    maxWidth: 0.5,
    dotSize: 1,
    backgroundColor: "rgb(255, 255, 255)",
  });
  llamarColorBotonGeneral(".w3-btn");
}

