/*--------------------------------------------------------------------
Fecha: 06/09/2018
Descripcion: Registra la firma en una imagen
--------------------------------------------------------------------*/
function accFirmConfAS1() {
  try {
    if (signaturePad.isEmpty()) {
      window.myalert(
        '<center><i class="fa fa-exclamation-triangle"></i>5 ALERTA</center>',
        "<center>Ingrese la firma correspondiente</center>"
      );
      return;
    }

    document.getElementById("firmaOTAS").value = "";
    document.getElementById("imgFirmaOTAS").innerHTML = "";

    var data = signaturePad.toDataURL("image/jpeg");
    document.getElementById("firmaOTAS").value = data;

    signaturePad.clear();

    // OT - FIRMA
    try {
      var dialogfirmaOTAS = $("#dialogfirmaOTAS").data("kendoDialog");
      dialogfirmaOTAS.close();
    } catch (ed010) {}

    document.getElementById("imgFirmaOTAS").innerHTML =
      "<img src='" +
      document.getElementById("firmaOTAS").value +
      "' width='400' height='300'>";
  } catch (error) {
    alert("3" + error);
  }
}
