function ConsultarGarantia(vin) {
  var respuestaGara = "";
  document.getElementById("es_garantia").value = "";
  try {
    var params = {
      Dt1: vin,
    };
    $.ajax({
      url: UrlGarantiaSql,
      type: "POST",
      data: JSON.stringify(params),
      async: false,
      dataType: "json",
      headers: {
        "Content-Type": "application/json;charset=UTF-8",
      },
      success: function (datas) {
        try {
          respuestaGara = datas.bdt1;
        } catch (e) {
          alert("00" + e);
          alert("No existe datos para esta consulta", "mens");
          kendo.ui.progress($("#lector_barrasScreen"), false);
          return;
        }
      },
      error: function (err) {
        alert("gara" + inspeccionar(err));
        alert("Alerta en consulta OT", "mens");
        kendo.ui.progress($("#lector_barrasScreen"), false);
        return;
      },
    });
  } catch (e) {
    alert("01" + e);
    mens("Alerta de conexi" + String.fromCharCode(243) + "n a base", "mens");
    kendo.ui.progress($("#lector_barrasScreen"), false);
    return;
  }
  return respuestaGara;
}

