function EnviarPacksNuevo(estado, secuencia_tl48) {
  try {
    var inforOt = inforOTPacks;
    var tipo = tipoPacks;
    if (estado != undefined) {
      var modo = "2";
      var mensaje = "Desea asignar el pack a esta ot ?";
      var mensajeResul = "Se asigno correctamente el pack";
      if (estado == "DEVENGADO") {
        modo = "3";
        mensaje = "Desea eliminar el pack de esta ot ?";
        mensajeResul = "Se elinimo el pack de esta ot correctamente";
      }
      kendo
        .confirm(
          '<center><h1><i class="fa fa-cloud-upload"></i> PACKS</h1><br />' +
            mensaje +
            "</center>"
        )
        .done(function () {
          kendo.ui.progress($("#lector_barrasScreen"), true);
          setTimeout(function () {
            var UrlEnvio =
              localStorage.getItem("ls_url2").toLocaleString() +
              "/Services/TL/Taller.svc/tl48PacksGet/" +
              modo +
              ",json;" +
              inforOt.codigo_empresa +
              ";" +
              inforOt.chasis +
              ";" +
              localStorage.getItem("ls_usulog").toLocaleString() +
              ";" +
              estado +
              ";" +
              inforOt.codigo_sucursal +
              ";" +
              inforOt.codigo_taller +
              ";" +
              inforOt.anio +
              ";" +
              inforOt.secuencia_orden +
              ";" +
              secuencia_tl48;
              
            EnviarPacks(UrlEnvio, inforOt, tipo, mensajeResul);
          }, 2000);
        })
        .fail(function () {
          kendo.ui.progress($("#lector_barrasScreen"), false);
        });
      llamarColorBotonGeneral(".k-primary");

      kendo.ui.progress($("#lector_barrasScreen"), false);

      return true;
    }
  } catch (f) { alert(f);
    kendo.ui.progress($("#lector_barrasScreen"), false);
    //window.myalert('<center><i class="fa fa-exclamation-triangle"></i>12 ERROR12</center>',f);
    //return;
  }
}
